css:
.status {
  font-weight: normal;
  color: #444444;
  text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5);
}
.status-added {
  color: #45a815;
  text-shadow: none;
}
.status-ignored {
  font-weight: normal;
  color: #999999;
  text-shadow: none;
}
.status-modified {
  color: #cd8e00;
  text-shadow: none;
}
.status-removed {
  color: #cc0000;
  text-shadow: none;
}
.status-renamed {
  color: #5293d8;
  text-shadow: none;
}
/*
* Modal
*/
.quick-query-modal-message {
  padding-right: 10px;
}
.quick-query-modal-message span.icon-x {
  position: absolute;
  top: 4px;
  right: 0;
  color: #9f9f9f;
}
.quick-query-modal-message span.icon-clippy {
  margin-left: 5px;
  cursor: pointer;
}
atom-panel.modal:hover .quick-query-modal-message span.icon-clippy {
  animation: in 0.8s linear 0s;
}
@keyframes in {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}
atom-panel.modal:not(:hover) .quick-query-modal-message span.icon-clippy {
  opacity: 0;
}
atom-panel.modal:not(:hover) .quick-query-modal-message.animated span.icon-clippy {
  animation: out 0.8s linear 0s;
}
@keyframes out {
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
}
/*
* Editor
*/
#quick-query-default-is-null {
  border-width: 1px;
  border-style: solid;
  border-color: rgba(159, 159, 159, 0.9);
  height: 25px;
  padding: 5px;
  border-radius: 2px;
  font-style: italic;
}
/*
* Browser
*/
ol#quick-query-connections {
  padding-bottom: 25px;
}
.list-tree li.list-nested-item.quick-query-database.default > .list-item.header {
  font-weight: bold;
}
.list-tree li.list-nested-item.quick-query-connection.default > .list-item.header {
  font-weight: bold;
}
atom-panel.right .quick-query-browser {
  height: inherit;
}
/*
*	Query Result
*/
.quick-query-result {
  overflow: hidden;
  position: relative;
}
.quick-query-result .quick-query-result-resize-handler {
  height: 5px;
  cursor: ns-resize;
}
.quick-query-result table.table.quick-query-result-numbers {
  overflow: hidden;
  margin-left: 0;
  position: absolute;
  width: auto;
  left: 0;
  top: 4px;
}
.quick-query-result table.table.quick-query-result-numbers thead tr th {
  text-align: center;
  width: 100%;
  position: absolute;
  z-index: 2;
  background-color: #f4f4f4;
}
.quick-query-result table.table.quick-query-result-numbers tbody {
  overflow: hidden;
  text-align: center;
}
.quick-query-result table.table.quick-query-result-numbers tbody tr:nth-child(even) {
  font-weight: bold;
  background-color: #e0e0e0;
}
.quick-query-result table.table.quick-query-result-numbers tbody tr:nth-child(odd) {
  font-weight: bold;
  background-color: #cbcbcb;
}
.quick-query-result .quick-query-result-table-wrapper {
  width: inherit;
  overflow: auto;
}
.quick-query-result table.table.quick-query-result-table thead {
  z-index: 1;
  background-color: #f4f4f4;
  margin-top: 4px;
  position: absolute;
  top: 0;
  margin-left: 1px;
}
.quick-query-result table.table {
  height: 94.5%;
  color: #444444;
  margin-bottom: 0;
}
.quick-query-result table.table tbody,
.quick-query-result table.table thead {
  display: block;
}
.quick-query-result table.table tbody {
  height: 100%;
  overflow-y: hidden;
  overflow-x: hidden;
}
.quick-query-result table.table tbody tr:nth-child(even) {
  background-color: #f4f4f4;
}
.quick-query-result table.table tbody tr:nth-child(odd) {
  background-color: #ececec;
}
.quick-query-result table.table tbody tr.added {
  height: 33px;
}
.quick-query-result table.table tbody tr.added td,
.quick-query-result table.table tbody tr.added td.null {
  color: #45a815;
  text-shadow: none;
}
.quick-query-result table.table tbody tr.removed td {
  color: #cc0000;
  text-shadow: none;
}
.quick-query-result table.table tbody tr {
  width: 100%;
  height: 33px;
}
.quick-query-result table.table tbody tr td.editing {
  padding: 2px 0 0 0;
}
.quick-query-result table.table tbody tr td.null.status-modified {
  color: #cd8e00;
  text-shadow: none;
}
.quick-query-result table.table tbody tr td.null {
  color: #d1d1d1;
  font-style: italic;
}
.quick-query-result table.table tbody tr td {
  overflow: ellipsis;
  text-overflow: ellipsis;
  white-space: nowrap;
}
atom-panel.bottom .quick-query-result {
  height: 275px;
}
.dialog.quick-query-connect select {
  color: #444444;
  background-color: #ffffff;
  border-color: #9f9f9f;
  padding: 3px 12px;
  margin-bottom: 10px;
}
.dialog.quick-query-connect #quick-query-browse-file {
  width: 100%;
}
.dialog.quick-query-connect .qq-local-info {
  display: none;
}
/*
	Bootstrap grid system was removed in atom v1.10
*/
.dialog.quick-query-connect .col-sm-3,
.quick-query-editor .col-sm-3,
.dialog.quick-query-connect .col-sm-9,
.quick-query-editor .col-sm-9,
.dialog.quick-query-connect .col-sm-6,
.quick-query-editor .col-sm-6,
.dialog.quick-query-connect .col-sm-12,
.quick-query-editor .col-sm-12 {
  padding-right: 15px;
  padding-left: 15px;
}
.dialog.quick-query-connect .row,
.quick-query-editor .row {
  clear: both;
}
@media (min-width: 544px) {
  .dialog.quick-query-connect .row .col-sm-1,
  .quick-query-editor .row .col-sm-1 {
    float: left;
    width: 8%;
  }
  .dialog.quick-query-connect .row .col-sm-2,
  .quick-query-editor .row .col-sm-2 {
    float: left;
    width: 16%;
  }
  .dialog.quick-query-connect .row .col-sm-3,
  .quick-query-editor .row .col-sm-3 {
    float: left;
    width: 25%;
  }
  .dialog.quick-query-connect .row .col-sm-9,
  .quick-query-editor .row .col-sm-9 {
    float: left;
    width: 75%;
  }
  .dialog.quick-query-connect .row .col-sm-6,
  .quick-query-editor .row .col-sm-6 {
    float: left;
    width: 50%;
  }
}
